import React from 'react';

const ArrowNoStem = () => (
	<svg viewBox="0 0 7 10">
		<g id="02-Navigation" stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
			<polygon id="Path" fill="#2F2F2F" transform="translate(3.662687, 5.000000) rotate(-90.000000) translate(-3.662687, -5.000000) " points="8.66268657 1.66268657 3.75493749 8.33731343 -1.33731343 1.66268657"></polygon>
		</g>
	</svg>
);

export default ArrowNoStem;
